import React from "react";
import { Link } from "react-router-dom";
import Movies from "../components/Movies";
const Listmov = ({ props }) => {
  if (!props) {
    return (
      <h1 className="color centrado has-background-danger">NO SE ENCONTRARON RESULTADOS :(</h1>
    );
  } else if (props) {
    return (
      <div>
        <h1 className="has-background-success">RESULTADOS:</h1>
      <div className="flex-card spaces">
        {props.map((movies, i) => {
          return (
            <div key={i}>
              <Link to={`/movies/${movies.imdbID}`}>
                <Movies props={movies} />
              </Link>
            </div>
          );
        })}
      </div>
      </div>
    );
  }
};

export default Listmov;
